INSERT INTO problems VALUES (173,'The radius of a sphere is increasing at a rate of 4 mm/s. How fast is the volume increasing when the diameter is 80 mm?','$25,600\\pi$ mm/s.','related rates','Related rates sphere volume.','');
INSERT INTO problems VALUES (174,'A street light is mounted at the top of a 15-ft-tall pole. A man 6 ft tall walks away from the pole with a speed of 5 ft/s along a straight path. How fast is the tip of his shadow moving when he is 40 ft from the pole?','$25/3$ ft/s.','related rates','Related rates similar triangles.','');
INSERT INTO problems VALUES (164,'A ladder $10$ ft long rests against a vertical wall. If the bottom of the ladder slides away from the wall at a rate of $1$ ft/sec, how fast is the top of the ladder sliding down the wall when the bottom of the ladder is $6$ ft from the wall?','$-\\frac34$ ft/s.','related rates','Related rates pythagorean theorem.','');
INSERT INTO problems VALUES (165,'Sally really likes bubble-yum$^{\\text{TM}}$. Scientific tests have proven that the maximum volume that a single piece of bubble-yum$^{\\text{TM}}$ can attain is $8$ in$^3$. One day, Sally is blowing a bubble, the radius of which is increasing at a constant rate of $1$ in/sec. Supposing Sally\'s bubble reaches maximum volume, what is the rate at which the volume of the bubble is changing the moment the bubble explodes?','$4\\sqrt[3]{36\\pi}$ in$^3$/s.','related rates','Related rates sphere volume.','');
INSERT INTO problems VALUES (166,'A baseball diamond is a square with side $90$ ft. A batter hits the ball and runs toward first base with a speed of $24$ ft/s. At what rate is his distance from second base decreasing when he is halfway to first base? At what rate is his distance from third base increasing at the same moment?','$-\\frac{1080}{\\sqrt{90^2+40^2}}$ ft/s, $\\frac{1080}{\\sqrt{90^2+40^2}}$ ft/s.','related rates','Related rates pythagorean theorem.','');
INSERT INTO problems VALUES (167,'Two people start from the same point. One walks east at $3$ mi/h and the other walks north at $2$ mi/h. How fast is the distance between the people changing after $15$ minutes?','$\\sqrt{13}$ mph.','related rates','Related rates pythagorean theorem.','');
INSERT INTO problems VALUES (168,'Sand falls from an overhead bin and accumulates in a conical pile with a radius that is always three times its height. Suppose the height of the pile increases at a rate of 2 cm/s when the pile is 12 cm high. At what rate is the sand leaving the bin at that instant?','$2592\\pi$ cm$^3$/s.','related rates','Related rates cone volume.','');
INSERT INTO problems VALUES (169,'A coffee pot in the form of a circular cylinder of radius $4$ in is being filled with water flowing at a constant rate. If the water level is rising at the rate of 0.3 in/sec, what is the rate at which the water is flowing into the coffee pot?','$\\frac{24}{5}\\pi$ in$^3$/s.','related rates','Related rates cylinder volume.','');
INSERT INTO problems VALUES (170,'A kite 100 ft above the ground moves horizontally at a speed of 8 ft/s. At what rate is the angle between the string and the horizontal decreasing when 200 ft of string has been let out?','$-\\frac{1}{50}$ rad/s.','related rates','Related rates trig functions.','');
INSERT INTO problems VALUES (171,'The height of a triangle is increasing at a rate of $1$ cm/min while the area of the triangle is increasing at a rate of $2$ cm$^2$/min. At what rate is the base of the triangle changing when the height is $10$ cm and the area is $100$ cm?','$-\\frac{8}{5}$ cm/min.','related rates','Related rates area of triangle.','');
INSERT INTO problems VALUES (172,'Consider the following situation. Two runners start at opposite ends of a circular track and begin to run in opposite directions: one on the inside lane at a rate of 5m/s and another in the outside lane at a rate of 4m/s. If the radii of the inside and outside tracks are 90m and 100m respectively, find the rate at which the runners are moving away from each other after 30 seconds.','$-8.385$ m/s.','related rates','Related rates law of cosines.','');
INSERT INTO problems VALUES (175,'A cylindrical tank with radius 5 m is being filled with water at a rate of 3 m$^3$/min. How fast is the height of the water increasing?','$\\frac{3}{25\\pi}$ m/min.','related rates','Related rates volume of cylinder.','');
INSERT INTO problems VALUES (176,'A man starts walking north at 4 ft/s from a point $P$. Five minutes later a woman starts walking south at $5$ ft/s from a point $500$ ft due east of $P$. At what rate are the people moving apart $15$ min after the woman starts walking?','$\\frac{837}{\\sqrt{8674}}$ ft/s.','related rates','Related rates pythagorean theorem.','');
INSERT INTO problems VALUES (177,'A boat is being pulled into a dock by a rope attached to the bow of the boat and passing through a pulley on the dock that is 1 m higher than the bow of the boat. If the rope is pulled in at a rate of 1 m/s, how fast is the boat approaching the dock when it is 8 m from the dock?','$\\sqrt{65}/8$ m/s.','related rates','Related rates trig functions.','');
