INSERT INTO problems VALUES (179,'A lighthouse is located on a small island 3 km away from the nearest point $P$ on a straight shoreline and its light makes 4 revolutions per minute. How fast is the beam of light moving along the shoreline when it is 2 km from $P$?','$80\\pi/3$ km/min.','related rates','Related rates trig functions.','');
